INSERT INTO `udacity` VALUES ('Developing Android Apps','https://in.udacity.com/course/new-android-fundamentals--ud851','','Build a cloud-connected Android app, and learn the tools, principles, and best practices of mobile and Android development that you\'ll apply to your own projects.',1),('Deep Learning','https://in.udacity.com/course/deep-learning--ud730','','Show off what you\'ve learned in your Nanodegree program with a project that defines',2),('Android Development for Beginners','https://in.udacity.com/course/android-development-for-beginners--ud837','','Learn the basics of Android and Java programming, and take the first step on your journey to becoming an Android developer!',3),('Android Basics: User Input','https://in.udacity.com/course/android-basics-user-input--ud836','','Learn how to make your apps interactive using buttons and text! In this course you\'ll learn the basics of the Java programming language and how to apply them to Android.',4),('Android Basics: Multi-screen Apps','https://in.udacity.com/course/android-basics-multi-screen-apps--ud839','','Learn to build multiple screens and link them together, expanding the range of apps you can create! You\'ll also learn how to play audio and add images to your apps.',5),('Android Basics: Networking','https://in.udacity.com/course/android-basics-networking--ud843','','This class teaches the basics of networking using Android, and is a part of the Android Basics Nanodegree by Google.',6),('Android Basics: Data Storage','https://in.udacity.com/course/android-basics-data-storage--ud845','','In this course, you\'ll learn the basics of data storage in Andriod, building your first database and an app that could be used for any small business!',7),('Web Accessibility','https://in.udacity.com/course/web-accessibility--ud891','','Get hands-on experience making web applications accessible. Youu2019ll understand when and why users need accessibility, then youu2019ll dive into how to implement.',8),('Client-Server Communication','https://in.udacity.com/course/client-server-communication--ud897','','Learn how a client communicates with a server, including HTTP\'s request and response cycle, HTTP/2 and HTTPs.',9),('Advanced Android App Development','https://in.udacity.com/course/advanced-android-app-development--ud855','','Make your app production-ready by applying advanced features like library integration, material design, widgets, receiving cloud messages, and more!',10),('Gradle for Android and Java','https://in.udacity.com/course/gradle-for-android-and-java--ud867','','Build bigger and better Android and Java apps using the Gradle build tool.',11),('Google Location Services on Android','https://in.udacity.com/course/google-location-services-on-android--ud876-1','','Enhance your apps with Google\'s Fused Location Provider, Activity Recognition, and Geofencing API capabilities.',12),('Google Analytics for Android','https://in.udacity.com/course/google-analytics-for-android--ud876-2','','Where in the world are people using your app? And how are they using your app? Take this course to learn how to answer these questions!',13),('Add Google Maps to your Android App','https://in.udacity.com/course/add-google-maps-to-your-android-app--ud876-4','','Maps on mobile devices have changed the world for millions of users. Learn how to use the Google Maps API to extend this functionality to your apps.',14),('Android Performance','https://in.udacity.com/course/android-performance--ud825','','Performance matters to users, so it must matter to you. Learn how to identify and fix bottlenecks in your Android applications, and ensure a smooth user experience.',15),('Material Design for Android Developers','https://in.udacity.com/course/material-design-for-android-developers--ud862','','Learn and apply the material design principles that define Android\'s visual language to your apps.',16),('Android Wear Development','https://in.udacity.com/course/android-wear-development--ud875A','','Learn how to extend your app to Android Wear smartwatches, allowing you to reach users wherever and whenever they\'d want or need your app.',17),('Android TV and Google Cast Development','https://in.udacity.com/course/android-tv-and-google-cast-development--ud875B','','Go where your users are: the living room! This course shows you how to extend your existing Android app to also work on Android TV, and/or with Google Cast.',18),('Android Auto Development','https://in.udacity.com/course/android-auto-development--ud875C','','Reach your users while they\'re out and about by extending your Media or Messaging app to Android Auto!',19),('Get Your Startup Started','https://in.udacity.com/course/get-your-startup-started--ud806','','Acquire the know-how necessary to see your business grow towards its next milestone.',20),('Product Design','https://in.udacity.com/course/product-design--ud509','','Learn product validation, UI/UX practices, Googleu2019s Design Sprint and the process for setting and tracking actionable metrics.',21),('App Monetization','https://in.udacity.com/course/app-monetization--ud518','','Learn how to effectively develop, implement, and measure your monetization strategy, iterating on the model as appropriate.',22),('Rapid Prototyping','https://in.udacity.com/course/rapid-prototyping--ud723','','Learning to prototype will save you time and money in the development process. Youu2019ll create quality apps faster and have confidence in the viability of your products.',23),('App Marketing','https://in.udacity.com/course/app-marketing--ud719','','This course will help you organize a strategy of identifying your perfect user, and teach you how to grow your user base by focusing your product on their needs.',24),('2D Game Development with libGDX','https://in.udacity.com/course/2d-game-development-with-libgdx--ud405','','This course explores how to use LibGDX to build 2D games that run anywhere, from web browsers to mobile devices. At the end you will create a full game, called Icicles.',25),('How to Make a Platformer Using libGDX','https://in.udacity.com/course/how-to-make-a-platformer-using-libgdx--ud406','','This course will explore how to create a game called Giga Gal. Giga Gal is a platformer in which you run, collect energy packs, jump a bunch, and shoot enemies.',26),('Dynamic Web Applications with Sinatra','https://in.udacity.com/course/dynamic-web-applications-with-sinatra--ud268','','Sinatra is a micro-framework for quickly developing small Ruby applications for the web. In this course, you\'ll learn all about Sinatra, routing, and templating.',27),('The MVC Pattern in Ruby','https://in.udacity.com/course/the-mvc-pattern-in-ruby--ud270','','In this course youu2019ll learn how to organize your code, and why thatu2019s important. Youu2019ll be using the MVC Design Pattern in the web application micro-framework Sinatra.',28),('Deploying Applications with Heroku','https://in.udacity.com/course/deploying-applications-with-heroku--ud272','','Deploy your first web application using the Heroku platform and learn about the underlying mechanics of web hosting.',29),('Problem Solving with Advanced Analytics','https://in.udacity.com/course/problem-solving-with-advanced-analytics--ud976','','Learn a scientific approach to solving problems with data, a foundational skill for anyone interested in making data driven decisions in a business context.',30),('Creating an Analytical Dataset','https://in.udacity.com/course/creating-an-analytical-dataset--ud977','','Learn how to prepare data to ensure the efficacy of your analysis while improving fluency in Alteryx.',31),('Classification Models','https://in.udacity.com/course/classification-models--ud978','','Learn how to use classification predictive models to solve business problems involving non-numeric data.',32),('A/B Testing for Business Analysts','https://in.udacity.com/course/ab-testing--ud979','','The A/B Testing course provides students with the foundational knowledge to design and analyze A/B tests to create business insights and support decision making.',33),('Offline Web Applications','https://in.udacity.com/course/offline-web-applications--ud899','','Learn how to develop offline-first web application using Service Workers and IndexedDB.',34),('JavaScript Promises','https://in.udacity.com/course/javascript-promises--ud898','','Learn how to simplify asynchronous work with Native JavaScript Promises!',35),('Building High Conversion Web Forms','https://in.udacity.com/course/building-high-conversion-web-forms--ud890','','Increase conversions with best practices for fast, efficient forms! Learn how to design and build web forms for users on any device.',36),('Web Tooling & Automation','https://in.udacity.com/course/web-tooling-automation--ud892','','In this course, youu2019ll learn how to setup your development environment and save a lot of time and effort with automatic optimization.',37),('Designing RESTful APIs','https://in.udacity.com/course/designing-restful-apis--ud388','','Build and secure a web server with a RESTful Developer-Friendly API that developers will love to use.',38),('Writing READMEs','https://in.udacity.com/course/writing-readmes--ud777','','Documentation is an important part of the development process. Learn to write READMEs using Markdown so your code can be used by other humans!',39),('Intro to DevOps','https://in.udacity.com/course/intro-to-devops--ud611','','Learn all about the DevOps landscape, workflow, and a survey of the systems currently being used to support scalable software deployment.',40),('Intro to HTML and CSS','https://in.udacity.com/course/intro-to-html-and-css--ud304','','Learn how to convert digital design mockups into static web pages and how to build a responsive portfolio site to showcase your work.',41),('Intro to Computer Science','https://in.udacity.com/course/intro-to-computer-science--cs101','','Learn key computer science concepts in this introductory Python course. You\'ll learn by doing, and will build your own search engine and social network.',42),('JavaScript Basics','https://in.udacity.com/course/javascript-basics--ud804','','Learn JavaScript syntax and coding conventions that web developers use to create interactive and dynamic websites while you create an online ru00e9sumu00e9 for your portfolio.',43),('Linux Command Line Basics','https://in.udacity.com/course/linux-command-line-basics--ud595','','An introduction to the Linux command line interface.',44),('How to Use Git and GitHub','https://in.udacity.com/course/how-to-use-git-and-github--ud775','','Learn to use version control, an important tool for any developer. The course will focus on Git, a specific version control system, and GitHub, a collaboration platform.',45),('Programming Foundations with Python','https://in.udacity.com/course/programming-foundations-with-python--ud036','','Introductory programming class to learn Object-Oriented Programming, a must-have technique to reuse and share code easily. Learn by making projects that spread happiness!',46),('Intro to iOS App Development with Swift','https://in.udacity.com/course/intro-to-ios-app-development-with-swift--ud585','','Take the first step in becoming an iOS Developer by learning about Swift and writing your first app.',47),('Intro to Java Programming','https://in.udacity.com/course/intro-to-java-programming--cs046','','Start with this basic introduction to Java programming if you\'ve never studied the language before and practice essential computer science concepts.',48),('Intro to Relational Databases','https://in.udacity.com/course/intro-to-relational-databases--ud197','','Relational databases are a powerful tool used throughout the industry. Learn the basics of SQL and how to connect your Python code to a relational database.',49),('Full Stack Foundations','https://in.udacity.com/course/full-stack-foundations--ud088','','Learn the fundamentals of back-end web development by creating your own web application from the ground up using the iterative development process.',50),('Authentication & Authorization: OAuth','https://in.udacity.com/course/authentication-authorization-oauth--ud330','','Learn to implement the OAuth 2.0 framework to allow users to securely and easily login to your web applications.',51),('Responsive Web Design Fundamentals','https://in.udacity.com/course/responsive-web-design-fundamentals--ud893','','Learn and practice strategies for developing websites that look great on every device! Made with Google\'s Pete LePage.',52),('Responsive Images','https://in.udacity.com/course/responsive-images--ud882','','Go beyond image tags! Learn how to make images a part of your responsive design workflow.',53),('Browser Rendering Optimization','https://in.udacity.com/course/browser-rendering-optimization--ud860','','This course will demystify the browser\'s rendering pipeline and make it easy for you to build high performance web apps.',54),('Developing Scalable Apps in Python','https://in.udacity.com/course/developing-scalable-apps-in-python--ud858','','You will learn about challenges of building applications that can serve hundreds of thousands of users, and how you can prepare for them as a developer.',55),('JavaScript Design Patterns','https://in.udacity.com/course/javascript-design-patterns--ud989','','Learn the importance of code organization and how to implement it with either vanilla JavaScript or an organizational library or framework.',56),('Learn Backbone.js','https://in.udacity.com/course/learn-backbonejs--ud990','','This is a collection of curated resources to teach you how to write well organized web applications using the Backbone framework.',57),('JavaScript Testing','https://in.udacity.com/course/javascript-testing--ud549','','Learn how to iterate on your web applications with confidence using the red-green-refactor workflow cycle and automated testing frameworks.',58),('Configuring Linux Web Servers','https://in.udacity.com/course/configuring-linux-web-servers--ud299','','Serve a data-driven web application as you become acquainted with, configure and finally secure a Ubuntu Linux web application server.',59),('How to Build a Startup','https://in.udacity.com/course/how-to-build-a-startup--ep245','','Learn what it takes to build a successful startup using the Customer Development process, where entrepreneurs \"get out of the building\" to gather and iterate on feedback.',60),('Learn Swift Programming Syntax','https://in.udacity.com/course/learn-swift-programming-syntax--ud902','','This course focuses on the syntax of the Swift programming language. By the end of the course, you\'ll be able to apply Swift essentials to building iOS apps.',61),('UIKit Fundamentals','https://in.udacity.com/course/uikit-fundamentals--ud788','','Learn the iOS UIKit framework, which is the cornerstone of creating user interfaces in all iOS apps and crucial for any iOS Developer to be intimately familiar with.',62),('Firebase in a Weekend: iOS','https://in.udacity.com/course/firebase-in-a-weekend-by-google-ios--ud0351','','This course will teach you when and why to choose Firebase as a backend for your iOS application.',63),('Firebase in a Weekend: Android','https://in.udacity.com/course/firebase-in-a-weekend-by-google-android--ud0352','','This course will teach you when and why to choose Firebase as a backend for your Android application.',64),('iOS Networking with Swift','https://in.udacity.com/course/ios-networking-with-swift--ud421','','Learn how to incorporate networking into your apps to access data from around the world. Build the On the Map app to share location and fun links with fellow students.',65),('Grand Central Dispatch (GCD)','https://in.udacity.com/course/grand-central-dispatch-gcd--ud576','','Learn how to prevent background operations from interfering with an app\'s UI by implementing Apple\'s GCD framework.',66),('iOS Persistence and Core Data','https://in.udacity.com/course/ios-persistence-and-core-data--ud325','','Persisting data is a core sk